•the realization of any risks described under this “Risk Factors” section, or other risks that may materialize in the future. The stock markets in general have experienced extreme volatility that has often been unrelated to the operating performance of particular companies. These broad market fluctuations may adversely affect the trading price of our common stock and an active liquid and orderly trading market for our common stock may not be maintained. Active, liquid and orderly trading markets usually result in less price volatility and more efficiency in carrying out investors’ purchase and sale orders. We cannot predict the extent to which investor interest in our common stock will lead to the maintenance of an active trading market on the NYSE or otherwise how liquid that market might continue to be. If an active public market for our common stock is not sustained, it may be difficult for you to sell your shares at a price that is attractive to you or at all.
